        [Test]
        public async Task Criar_Agendamento_Sem_Titulo()
        {
            try
            {
                CreateDTO dto = new CreateDTO()
                {

                    descricao = "essa e uma campanha teste",
                    tipoCampanhaId = 1,
                    tipoArrecadacaoId = 1,
                    imageCapaBase64 = "base64",
                    metaArrecadacao = 1000,
                    unidadeMedidaId = 1,
                    dataLimite = "2021-11-09",
                    pontosColeta = null

                };

                CreateUseCase useCase = new CreateUseCase();
                var create = await useCase.create(dto);

                Assert.IsFalse(create.sucesso);
                Assert.AreEqual(create.error.errorMessage, "titulo e obrigatorio");
            }
            catch (Exception ex)
            {
                throw ex;
               
            }
        }

